import React from 'react';

const GroupPublic = ({ onClick, showButton }) => {
    const text = "Your Fixed Text";

    return (
        <div>
        {showButton && (
            <button onClick={onClick}>
            {text}
            </button>
        )}
        </div>
    );
};

